import React from "react";
import "./Polaroid.css";

function Polaroid(props) {
  return (
    <div class="polaroid">
      <img
        src={"../../views/fdf.jpg"}
        alt="Castle"
        style={{ width: "13vw", borderRadius: "8px" }}
      />
      <div class="container">
        <p>{props.texte}</p>
      </div>
    </div>
  );
}

export default Polaroid;
